import React from 'react';
import NavbarStyle from './Navbar.module.scss';
import logo from './Images/logo.webp';
const Navbar = () => {
	return (
		<div>
		<nav className={`container container-fluid`} >
			<div className={`navbar ${NavbarStyle.navbar} `}>
				<a className="navbar-brand">
					<img src={logo} alt="Portfolio" />
				</a>
				<div className={`${NavbarStyle.navItems}`}>
					<div>
					<a className={NavbarStyle.navlink} href="#" >Home</a>
					<a className={NavbarStyle.navlink} href="#" >About</a>
					<a className={NavbarStyle.navlink} href="#" >Services</a>
					<a className={NavbarStyle.navlink} href="#" >Portfolio</a>
					<a className={NavbarStyle.navlink} href="#" >Page</a>
					<a className={NavbarStyle.navlink} href="#" >Contact</a>
					</div>
					<div className={NavbarStyle.navbutton} href="#" ><span className={NavbarStyle.navbuttontext}>Get Free Consultant</span></div>
				</div>
			</div>
		</nav >
		<h1>HI</h1>
		</div>

	);
}
export default Navbar;
